export type SvgIconName = keyof typeof SVG_ICONS

export interface SvgIconProps {
  style?: StyleProp<ViewStyle>
  size: number
  color: ColorValue
  name: SvgIconName
}

export function SvgIcon(props: SvgIconProps) {
  const { style, size, color, name } = props
  const { v, d } = SVG_ICONS[name]

  return (
    <Svg style={style} viewBox={v} width={size} height={size}>
      <Path fill={color} d={d} />
    </Svg>
  )
}

export interface AnimatedSvgIconProps {
  style?: StyleProp<ViewStyle>
  size: number
  color: ColorValue
  name: SvgIconName
  animatedProps: Partial<PathProps>
}

export function AnimatedSvgIcon(props: AnimatedSvgIconProps) {
  const { style, size, color, name, animatedProps } = props
  const { v, d } = SVG_ICONS[name]

  return (
    <AnimatedSvg style={style} viewBox={v} width={size} height={size}>
      <AnimatedPath d={d} fill={color} animatedProps={animatedProps} />
    </AnimatedSvg>
  )
}
